import { Header } from '../../components/Header';
import Imgbackground from '../../assets/github-white.svg';
import "./styles.css";

function App() {
  return (
    <div className="App">
      <Header />
      <div className="conteudo">
        <img src={Imgbackground} className="background" alt="background img app "/>

      </div>
    </div>
  );
}

export default App;
